        [Fact]
        public void GetAreaTest()
        {
            foreach (var v in PolygonsDic.Values)
            {
                Assert.True(v.CheckAreaConsistency(SmallGeometryComparer));
            }
        }

        [Fact]
        public void GetCentroidTest()
        {
            foreach (var v in PolygonsDic.Values)
            {
                Assert.True(v.CheckCentroidConsistency(SmallGeometryComparer));
            }
        }


        public class PolygonInfo
        {
            public double Area { get; }
            public FlatPoint Centroid { get; }
            public FlatPolygon Geometry { get; }



            public PolygonInfo(double area, FlatPoint centroid, FlatPolygon geometry)
            {
                ArgumentNullException.ThrowIfNull(geometry);
                Area = area;
                Centroid = centroid;
                Geometry = geometry;
            }



            /// <summary>
            /// 
            /// </summary>
            /// <param name="comparer"></param>
            /// <returns></returns>
            /// <exception cref="ArgumentNullException"></exception>
            public bool CheckAreaConsistency(SmallGeometryComparer comparer)
            {
                ArgumentNullException.ThrowIfNull(comparer);
                return comparer.IsRelativelySame(Area, Geometry.GetArea());
            }

            /// <summary>
            /// 
            /// </summary>
            /// <param name="comparer"></param>
            /// <returns></returns>
            /// <exception cref="ArgumentNullException"></exception>
            public bool CheckCentroidConsistency(SmallGeometryComparer comparer)
            {
                ArgumentNullException.ThrowIfNull(comparer);
                return comparer.IsSame(Centroid, Geometry.GetCentroid());
            }
        }
    }
